import React from 'react'
import { Link } from 'react-router-dom'

const Header = () => {
  return (
    <div>
      <ul>
        <li><Link to="/">Home</Link>&nbsp;</li>
        <li><Link to="/about">About</Link>&nbsp;</li>
      </ul>
      
      
      
    </div>
  )
}

export default Header
